import React,{Fragment} from "react";
import image from "../../assets/meals.jpg";

const Header = () =>{
    <Fragment>
        <header>
            <h1>React Meals</h1>
            <button>Your Cart</button>
        </header>
        <div>
            <img src={image} alt="A table full of delecious food" />
        </div>
    </Fragment>
}

export default Header;
